script: |
  super -f text -I q5375.spq | sort > q5375.out

inputs:
  - name: q5375.spq
    data: |
      SELECT DISTINCT 68 + + ( + - col0 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + col2 * + col1 * - + 94 ) IS NULL;
  - name: tab2

outputs:
  - name: q5375.out
    data: |
      -7
      22
      4
